import { Link } from 'react-router-dom'
import Card from 'react-bootstrap/Card'

function CardComponent(props) {
    return (

            <Card>
                <Card.Body>                    {props.data.map((item) => (
                    <div>
                        <h3>{item.title}</h3>
                        <Link to={`/info/${item.title}/`}>Дивитись статтю</Link>
                    </div>
                ))}</Card.Body>
            </Card>
  

    )
}

export default CardComponent
